Report the outstanding principal balance of all loans and other assets that have been sold to or originated into a SPV by or on behalf of the ADI or by a third party to a SPV sponsored by the ADI (e.g. Warehouse Trust). Do not include in these amounts any assets reported in "Total Australian residents assets".
Include loans to:
* households
* community service organisations/non-profit institutions serving households;
* non-financial corporations;
* life insurance corporations;
* pension funds;
* other insurance corporations; and
* other financial institutions (as defined in 'Other Definitions' above).
Exclude loans to:
* general government;
* RBA;
* banks;
* other ADIs;
* RFCs; and
* central borrowing authorities.
Also exclude any securitised intra-group loans.
